package nl.cwi.lcs;

import java.io.IOException;
import java.util.HashMap;
import java.util.Map;

import nl.cwi.entropy.CalculateEntropy;

public class XLS {
	private static String doc = "";
	
	private static String xls ="";
	
	public static boolean isXls(String path) throws IOException{
		String fragment1 = CalculateEntropy.getFragmentsContentAsStrings(path);
		String docLCS = LCS.longestSubstring(fragment1, doc);
		String xlsLCS = LCS.longestSubstring(fragment1, xls);
         if(docLCS.length() < xlsLCS.length()){
        	return true;
        }
         return false;
	}
}
